ALTER TABLE `authors`
  ADD PRIMARY KEY (`id`);


ALTER TABLE `junction_songs`
  ADD PRIMARY KEY (`id`),
  ADD KEY `Autor` (`author`),
  ADD KEY `Piosenka` (`song`);


ALTER TABLE `kupione`
  ADD PRIMARY KEY (`id`),
  ADD KEY `kupione_ibfk_1` (`kto`),
  ADD KEY `kupione_ibfk_2` (`co`);


ALTER TABLE `songs`
  ADD PRIMARY KEY (`id`);


ALTER TABLE `useraccounts`
  ADD PRIMARY KEY (`userId`),
  ADD UNIQUE KEY `userLogin` (`userLogin`) USING HASH;


ALTER TABLE `authors`
  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT;

ALTER TABLE `junction_songs`
  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT;

ALTER TABLE `kupione`
  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=14;


ALTER TABLE `songs`
  MODIFY `id` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=15;


ALTER TABLE `useraccounts`
  MODIFY `userId` int(11) NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=15;

ALTER TABLE `junction_songs`
  ADD CONSTRAINT `Autor` FOREIGN KEY (`author`) REFERENCES `authors` (`id`) ON DELETE CASCADE,
  ADD CONSTRAINT `Piosenka` FOREIGN KEY (`song`) REFERENCES `songs` (`id`) ON DELETE CASCADE;


ALTER TABLE `kupione`
  ADD CONSTRAINT `kupione_ibfk_1` FOREIGN KEY (`kto`) REFERENCES `useraccounts` (`userId`) ON DELETE CASCADE ON UPDATE CASCADE,
  ADD CONSTRAINT `kupione_ibfk_2` FOREIGN KEY (`co`) REFERENCES `songs` (`id`) ON DELETE CASCADE ON UPDATE CASCADE;
COMMIT;


